import React from 'react'
import style from 'styled-components';

const NominateTitle = style.h1`

  color: white;
  margin: 0 22% 0 22%;
  font-weight: bold;
  text-alignb
  font-size: 48px;

`;

const Wrapper = style.div`

  margin: 0 22% 0 22%;

`;

export default function Nominate() {
    return (
        <Wrapper>
            <NominateTitle>
                Start Nominating
            </NominateTitle>
        </Wrapper>
    );
}
